window.bookSummaryJSON = "<p>The author of the <i>New York Times</i> best seller <i>You Are the Placebo</i>, as well as <i>Breaking the Habit of Being Yourself </i>and <i>Evolve Your Brain</i>, draws on research conducted at his advanced workshops since 2012 to explore how common people are doing the uncommon to transform themselves and their lives. <i>Becoming Supernatural</i> marries the some of the most profound scientific information with ancient wisdom to show how people like you and me can experience a more mystical life.</p> <p>Listeners will learn that we are, quite literally supernatural by nature if given the proper knowledge and instruction, and when we learn how to apply that information through various meditations, we should experience a greater expression of our creative abilities; that we have the capacity to tune in to frequencies beyond our material world and receive more orderly coherent streams of consciousness and energy; that we can intentionally change our brain chemistry to initiate profoundly mystical transcendental experiences; and how, if we do this enough times, we can develop the skill of creating a more efficient, balanced, healthy body, a more unlimited mind, and greater access to the realms of spiritual truth. </p> <p>Topics include:</p> <p></p> <ul> <li>Demystifying the body’s seven energy centers and how you can balance them to heal</li> <li>How to free yourself from the past by reconditioning your body to a new mind</li> <li>How you can create reality in the generous present moment by changing your energy</li> <li>The difference between third-dimension creation and fifth-dimension creation</li> <li>The secret science of the pineal gland and its role in accessing mystical realms of reality</li> <li>The distinction between space-time vs. time-space realities</li> </ul> <p>And much more....</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio. </b></p>"; 
